    def __init__(self):
        ''' # adapted from c++ code by @cuiaoxiang 
        def check(x):
            t, y = x, 0
            while t:
                y = y*10 + candidates[t%10]
                t //= 10
            return x == y

        def search(pos, cur):
            if cur > n: return
            if cur and check(cur): self.palindromes += 1

            for can in candidates:
                if pos == can == 0: continue
                search(pos+1, cur*10 + can)

        candidates = dict(zip(map(int, '01689'), map(int, '01986')))
        self.palindromes = []; search(0, 0)
        '''
    
    def confusingNumberII(self, n: int) -> int:
        VALID = '0111116689'
        TIMES = dict(zip('01689', range(5)))
        
        # Find the max valid number < n
        n = str(n); length = len(n)
        for i, x in enumerate(n):
            if x in '23457':
                n = n[:i] + VALID[int(x)]; break
        n = int(n + (length-i-1)*'9')

        total = sum(
            TIMES[x] * 5**i
            for i, x in enumerate(reversed((str(n))))
        ) + 1

        return total - sum(p<=n for p in self.palindromes)